import React from "react";
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

function Test() {
    return (
        <div className="App">

            <Router>
                <Switch>
                    <Route exact path="/" component={Test} />
                </Switch>
            </Router>
        </div>
    );
}

export default Test;
